import "./homepage.css";

const Homepage = () => {
  return (
    <section className="homepage-section">
      <div className="homepage-hero width-100 center-text">
        <div className="hero-text ">
          <div className="textbox">
            <div className="title is-6">
              TRADEPLAY <i class="fas fa-play"></i>
            </div>
            <div className="subtitle is-4">
              Curated videos to learn trading the fast way
            </div>
          </div>
          <button className="btn-primary btn-large br-1">Start Learning</button>
        </div>
      </div>
      <div className="homepage-videos"></div>
      <div className="homepage-categories"></div>
    </section>
  );
};

export { Homepage };
